import React, { Component } from "react";
import { connect } from "react-redux";
import LoginComponent from "../components/LoginComponent";

class LoginContainer extends Component {
  render() {
    return (
      <div>
        <LoginComponent />
      </div>
    );
  }
}

export default connect()(LoginContainer);
